class Search extends React.Component{
  render(){
    return(
      <form className="search" action="action_page.php">
        <input type="text" placeholder="Search.." name="search"/>
          <button type="submit"><i className="fa fa-search"></i></button>
      </form>
    )
  }
}
export default Search
